// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
import "hardhat/console.sol";

library BluebirdMath {
    /**
     * Compute standard deviation of an array of values
     * @param _values Array of values
     * @return Standard deviation of `_values`
     */
    function computeStandardDeviation(uint256[] memory _values) internal pure returns (uint256) {
        uint256 n = _values.length;
        uint256 mean = 0;

        // Compute mean
        for (uint256 i = 0; i < n; i++) {
            mean += _values[i];
        }
        mean = mean / n;
        // Compute sum of squared differences
        uint256 sumSquaredDifferences = 0;
        for (uint256 i = 0; i < n; i++) {
            uint256 difference;
            if (_values[i] > mean) {
                difference = _values[i] - mean;
            } else {
                difference = mean - _values[i];
            }

            sumSquaredDifferences += difference * difference;
        }

        // Compute variance and standard deviation
        uint256 variance = sumSquaredDifferences / n;
        uint256 standardDeviation = sqrt(variance);

        return standardDeviation;
    }

    /**
     * Square root function
     * @param x Input x
     * @return Square root of `x`
     */
    function sqrt(uint256 x) internal pure returns (uint256) {
        uint256 z = (x + 1) / 2;
        uint256 y = x;
        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }
        return y;
    }
}

contracts/MockOracle.sol.content:
pragma solidity ^0.8.0;

// Import aggregatorv3
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract MockOracle is AggregatorV3Interface {
    int256 public price;
    uint8 public decimals;
    string public description;
    uint256 public version = 1;
    uint80 public roundId = 1;
    mapping(uint80 => int256) public answers;
    event AnswerUpdated(int256 indexed current, uint256 indexed roundId, uint256 updatedAt);

    constructor(int256 _price, uint8 _decimals, string memory _description) {
        price = _price;
        answers[roundId] = price;
        decimals = _decimals;
        description = _description;
    }

    function getRoundData(uint80 _roundId) public view override returns (uint80, int256, uint256, uint256, uint80) {
        return (_roundId, answers[_roundId], 0, 0, 0);
    }

    function latestRoundData() public view override returns (uint80, int256, uint256, uint256, uint80) {
        return (roundId, price, 0, 0, 0);
    }

    function setPrice(int256 _price) public {
        price = _price;
        answers[roundId] = price;
        emit AnswerUpdated(price, roundId, block.timestamp);
        roundId++;
    }
}

